    "Innovative high efficiency filter for Mars dust Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:48:49.231447",nt"name": "innovative-high-efficiency-filter-for-mars-dust-project",nt"isopen":
    true,nt"url": null,nt"notes": "To reduce the cost of space travel, NASA
    is developing In-Situ Resource Utilization (ISRU) methods to collect and convert
    local resources into products that can be used during the mission. Towards this
    objective, BlazeTech is proposing the development of an innovative system to filter
    Mars dust from gas streams. Our system combines the cyclone concept with a spinning
    and cylinder that acts as a self cleaning filter. The main advantages of the proposed
    device over conventional systems are the self-cleaning aspect of the filter surface
    a reduction in pressure drop and volume requirements.  This makes the concept particularly
    suitable for NASA's requirements which include a modest throughput but a high capture
    efficiency of the fine particles.",nt"license_title": "U.S. Government Work",nt"extras":
